                let name = $(this).data('name');
                let type = /\(([^)]+)\)/.exec(name);
                if (user.currency === 'usd') {
                    price /= 1000;
                }
                let max = Math.floor(price * 0.85);
                let min = Math.floor(price * 0.01);
